window.bookSummaryJSON = "<p>Matt is reincarnated as a Tree.</p> <p>Not just any tree, but an overpowered one in a fantasy world that serves as the battlefield for an ongoing conflict between demons and the heroes summoned to oppose them.</p> <p>But Matt can be a great tool against the evil forces. TreeTree (as Matt comes to be known) will learn all sorts of skills, gain levels, and in doing so, build up a forest, train young subordinates, protect a village, and more.</p> <p>Don't miss the start of an epic reincarnation/Isekai LitRPG story about a man who becomes a tree, growing and progressing throughout the ages in an eternal conflict against a demon incursion.</p>"; 
